import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from 'путь_к_AuthContext.js';
import styles from './MasterGroup.module.css';

export default function MasterGroupPages() {
  const navigate = useNavigate();
  const { isAuthenticated, userId } = useAuth();

  const goToByMG = () => {
    navigate('/by-master-group');
  };

  const goToByCource = () => {
    navigate('/by-cource');
  };

  const goToHomeWork = () => {
    navigate('/home-work');
  };

  const goToTeachers = () => {
    navigate('/teachers');
  };

  const goToProgress = () => {
    navigate('/progress');
  };

  const goToChat = () => {
    navigate('/chat');
  };

  const goToMyMG = () => {
    navigate('/my-master-group');
  };

  const goToMyCourses = () => {
    navigate('/my-courses');
  };

  const handleGetUserId = () => {
    if (isAuthenticated) {
      alert(`ID авторизованного пользователя: ${userId}`);
    } else {
      alert('Пользователь не аутентифицирован');
    }
  };

  return (
    <div>
      <form className={styles.LCForm}>
        <h1 className={styles.LCTitle}>Личный кабинет</h1>
        <div className={styles.LCButton}>
          <button onClick={goToByMG} className={styles.ByMGButton}>
            Купить мастер-группу
          </button>
          <button onClick={goToByCource} className={styles.ByCourceButton}>
            Купить курс
          </button>
        </div>
      </form>

      <form className={styles.Menu}>
        <div className={styles.MenuButton}>
          <button onClick={goToByMG} className={styles.MenuByMGButton}>
            Мастер-группы
          </button>
          <button onClick={goToByCource} className={styles.MenuByMGButton}>
            Курсы
          </button>
          <button onClick={goToHomeWork} className={styles.MenuByMGButton}>
            Домашние задания
          </button>
          <button onClick={goToTeachers} className={styles.MenuByMGButton}>
            Преподаватели
          </button>
          <button onClick={goToProgress} className={styles.MenuByMGButton}>
            Достижения
          </button>
          <button onClick={goToChat} className={styles.MenuByMGButton}>
            Общий чат
          </button>
          <button onClick={goToMyMG} className={styles.MenuByMGButton}>
            Основной курс
          </button>
          <button onClick={goToMyCourses} className={styles.MenuByMGButton}>
            Курсы
          </button>
          <button onClick={handleGetUserId} className={styles.GetUserIdButton}>
            Получить ID пользователя
          </button>
        </div>
        <h5 className={styles.my_mgStatus}>Вы еще ничего не выбрали</h5>
        <h5 className={styles.my_CourceStatus}>У вас нет курсов</h5>
        <hr className={styles.MenuByMGButton}/>
      </form>
    </div>
  );
}
